$(document).ready(function(){
  $("#rated").rating(function (vote, event) {
    var user_id = $(this).attr('data-user-id');

    $.ajax({
      type: 'post',
      url: '/users/' + user_id + '/rate',
      data: {rating: vote}
    });
    })
  })
